direction => {
  switch (appsmith.store.level) {
    case 'artist':
      if (direction == 'up') return 'Artists'; else if (direction == 'down') return 'Albums';
      break;
    case 'album':
      if (direction == 'up') return 'Artists'; else if (direction == 'down') return 'Tracks';
      break;
    case 'track':
      if (direction == 'up') return 'Albums'; else if (direction == 'down') return 'Artists';
      break;
  }
}

